import React, { Component } from "react";

import { Dashboard as DashboardLayout } from "layouts";

import Loader from "./components/loader";

import { connect } from "react-redux";
import { Content } from "serializers/content";
import swal from "sweetalert";
import { Typography } from "@material-ui/core";
import { APTITUDE } from "../../constants";

// styles
import styles from "./styles";
import { withStyles } from "@material-ui/styles";

class TopPanel extends Component {
  pauseGame() {
    this.props.pauseGame();
  }

  runGame() {
    if (this.props.aliveCount > 0) {
      this.props.runGame();
    }
  }

  clearBoard() {
    // true for clearSquares
    this.props.clearGame(true);
  }

  render() {
    let panelWidth = {
      width: this.props.width
    };
    return (
      <div style={panelWidth} className="top-controls">
        <button className="control-button" onClick={this.runGame.bind(this)}>
          Run
        </button>
        <button className="control-button" onClick={this.pauseGame.bind(this)}>
          Pause
        </button>
        <button className="control-button" onClick={this.clearBoard.bind(this)}>
          Clear
        </button>
        <div className="generations">Generations: {this.props.generations}</div>
      </div>
    );
  }
}

class StudymaterialList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      open: false,
      openMode: "Send",
      editData: null,
      contentTableData: [],
      isLoading: true
    };
  }

  render() {
    const { classes } = this.props;

    return (
      <DashboardLayout mode={APTITUDE} title="Conway's Game Of Life">
        <div className={classes.root}>gjhgj</div>
      </DashboardLayout>
    );
  }
}

const mapStateToProps = state => {
  return {
    token: state.auth.token
  };
};

export default connect(mapStateToProps)(withStyles(styles)(StudymaterialList));
